My book, Georgia’s Cakes is not just a recipe book. It is a step-by-step masterclass to make every cake a showstopper 💖

When I wrote this book, my intention was to pour all my cake knowledge onto paper and create a picture-led guide to cake decorating. I really felt that there was a gap in the market for exactly this, and from receiving you’re amazing reviews, messages and comments, I think I was right! 🥰

Georgia’s Cakes is available to buy from Amazon and will be released in the US on September 5th (available to pre-order now!)

